const unit = new Unit()

class Display {
    displayHeroes() {
       
            for (let hero of unit.wowHeroes) {
                const wowHero = document.createElement('div')
                const hn = document.createElement('h3')
                const health = document.createElement('h5')
                const heroImage = document.createElement('img')
                heroImage.style.borderRadius = '10px'
                const damage = document.createElement('p')
                const chooseBtn = document.createElement('button')
                heroImage.setAttribute('src', hero.image)
                chooseBtn.textContent = 'Choose hero'
                health.textContent = `Health: ${hero.health} hp`
                damage.textContent = `Damage: ${hero.damage}`
                hn.textContent = hero.name
                wowHero.className = 'wowHero'
                wowHero.appendChild(hn)
                wowHero.appendChild(heroImage)
                wowHero.appendChild(health)
                wowHero.appendChild(damage)
                wowHero.appendChild(chooseBtn)
                // wowHero.textContent = hero.name
                charsList.appendChild(wowHero)

                game.chosenFighters(chooseBtn)
            }
    }
}


const display = new Display()

class Game {
    chooseFighter() {
        alert('Choose your fighter!')
            startBtn.style.display = 'none'
            display.displayHeroes()


    }


    chosenFighters(e) {
        const computerHero = unit.wowHeroes[Math.floor(Math.random()*24)].name
        e.onclick = () => {
            battleField.style.display = 'grid'
            battleField.style.gridTemplateColumns = '1fr 1fr'
            computeredHero = computerHero
            choosedHero = e.parentNode.firstChild.textContent 
            fightBtn.classList.remove('hidden')
            for (let ish of 
                Array.from(charsList.childNodes)
                .filter(h => 
                    h.firstChild.textContent === e.parentNode.firstChild.textContent 
                    || h.firstChild.textContent === computerHero)) {
                    charsList.style.display = 'none'
                    battleField.appendChild(ish)
                    // battleField.childNodes.childNodes[3].style.display = 'none'
                    for (let uh of Array.from(battleField.childNodes)
                    .filter(h => 
                    h.firstChild.textContent === e.parentNode.firstChild.textContent 
                    || h.firstChild.textContent === computerHero)) {
                        uh.childNodes[4].style.display = 'none'
                    }
                    
             }
        }
    }

    gameOver(chel) {
        alert(chel[0].name)        
    }

    battle() {
        const myInterval = setInterval(() => {
           
            unit.wowHeroes.filter(hero => hero.name === choosedHero)[0].health-=unit.wowHeroes
            .filter(hero => hero.name === computeredHero)[0].damage
            unit.wowHeroes.filter(hero => hero.name === computeredHero)[0].health-=unit.wowHeroes
            .filter(hero => hero.name === choosedHero)[0].damage
            battleField.childNodes[0].childNodes[2].textContent = 
            `Health: ${unit.wowHeroes.filter(hero => hero.name === choosedHero)[0].health} hp`
            battleField.childNodes[1].childNodes[2].textContent = 
            `Health: ${unit.wowHeroes.filter(hero => hero.name === computeredHero)[0].health} hp`
            if (unit.wowHeroes.filter(hero => hero.name === choosedHero)[0].health <= -1 || 
                unit.wowHeroes.filter(hero => hero.name === computeredHero)[0].health <= -1) {
                let winner = unit.wowHeroes.filter(hero => (hero.name === choosedHero || hero.name === computeredHero) && hero.health > 0)
                // gameOver(winner)
                clearInterval(myInterval)
                alert('Winner is: '+ winner[0].name)
                    battleField.style.display = 'none'
                    startBtn.style.display = 'block'
                    fightBtn.style.display = 'none'
                    window.location = '/';
            }
        }, 500)
        
    }


}

const game = new Game()

startBtn.onclick = () => {
    game.chooseFighter()
    // game.choosedFighters()
}

fightBtn.onclick = () => {
    game.battle()
    fightBtn.style.display = 'none'
}